#!/bin/bash

datastorehost=$1
token=$2
tracing_id=$3
x=$4
version=$4



echo "version $version token $token tracing $tracing_id"

curl $datastorehost'/tracings/volume/'$tracing_id'/update?token='$token -H 'Accept: application/json' -H 'content-type: application/json' -H 'origin: http://localhost:9000' -H 'Connection: keep-alive' --data @- <<CURL_DATA
[{"version":$version,"timestamp":1546606827309,"actions":[
{"name":"updateBucket","value":{"position":[$x,1,1],"zoomStep":0,"cubeSize":32,"base64Data":"$data"}},
{"name":"updateBucket","value":{"position":[$(($x+1)),1,1],"zoomStep":0,"cubeSize":32,"base64Data":"$data"}},
{"name":"updateBucket","value":{"position":[$(($x+2)),1,1],"zoomStep":0,"cubeSize":32,"base64Data":"$data"}},
{"name":"updateBucket","value":{"position":[$(($x+3)),1,1],"zoomStep":0,"cubeSize":32,"base64Data":"$data"}},
{"name":"updateBucket","value":{"position":[$(($x+4)),1,1],"zoomStep":0,"cubeSize":32,"base64Data":"$data"}},
{"name":"updateBucket","value":{"position":[$(($x+5)),1,1],"zoomStep":0,"cubeSize":32,"base64Data":"$data"}},
{"name":"updateBucket","value":{"position":[$(($x+6)),1,1],"zoomStep":0,"cubeSize":32,"base64Data":"$data"}},
{"name":"updateBucket","value":{"position":[$(($x+7)),1,1],"zoomStep":0,"cubeSize":32,"base64Data":"$data"}}
],"stats":null}]
CURL_DATA
